import React from "react";
import {
  makeStyles,
  createMuiTheme,
  MuiThemeProvider,
} from "@material-ui/core/styles";
import { ThemeProvider } from "@material-ui/styles";
import TextField from "@material-ui/core/TextField";
import GenericButton from "../../components/GenericButton/index.js";
import "./Email.css";
import { red } from "@material-ui/core/colors";

const theme = createMuiTheme({
  palette: {
    main: red[900],
  },
});

const useStyles = makeStyles((theme) => ({
  root: {
    "& div.MuiTextField-root": {
      margin: theme.spacing(5),
      width: "50ch",
      display: "flex",
    },
    "& div.MuiInputBase-root": {
      borderRadius: "25px",
    },
    "& div.MuiFilledInput-underline:before": {
      borderBottom: "none",
    },
    "& div.MuiFilledInput-underline:after": {
      borderBottom: "none",
    },
    "& label.Mui-focused": {
      color: "palette.primary",
    },
  },
}));

// const theme = createMuiTheme({
//   overrides: {
//     MuiInputLabel: {
//       root: {
//         color: "yellow",
//       },
//     },
//   },
// });

function BasicTextFields() {
  const classes = useStyles();
  return (
    // need div tags that enclose entire return statement
    <div className="layout">
      <h1>
        exchange emails with your partner and write them a message. they will
        recieve it one hour after you click send.{" "}
      </h1>
      <form className={classes.root} noValidate autoComplete="off">
        <div className="partner">
          <ThemeProvider theme={theme}>
            <TextField
              id="outlined-basic"
              label="Partner's Email"
              variant="filled"
              color="primary"
            />
          </ThemeProvider>
        </div>
        <div>
          <TextField
            id="outlined-multiline-static"
            label="Message"
            multiline
            rows={4}
            variant="filled"
          />
        </div>
      </form>
      <div>
        <GenericButton label="send" className=""></GenericButton>
      </div>
    </div>
  );
}

export default BasicTextFields;
